import unittest
from trappingRainWater import Solution

class TestTrappingRainWater(unittest.TestCase):
  def test1(self):
    solver = Solution()
    inp = [0,1,0,2,1,0,1,3,2,1,2,1]
    output = solver.trap(inp)
    self.assertEqual(output, 6)

  def test2(self):
    solver = Solution()
    inp = [4,2,0,3,2,5]
    output = solver.trap(inp)
    self.assertEqual(output, 9)
    
